import React from "react";

const Form = ({user,setUser}) => {

    const handleChange = e => {
        setUser({
            [e.target.name]: e.target.value
        })
    }

    return (
        <form>
            <div className="mb-3">
                <label htmlFor="Nombres" className="form-label">Nombres</label>
                <input name="Nombres" onChange={handleChange} type="text" id="Nombres" className="form-control"/>
            </div>
            <div className="mb-3">
                <label htmlFor="Apellidos" className="form-label">Apellidos</label>
                <input onChange={handleChange} type="text" id="Apellido" className="form-control"/>
            </div>
            <div className="mb-3">
                <label htmlFor="Telefono" className="form-label">Telefono</label>
                <input onChange={handleChange} type="number" id="Telefono" className="form-control"/>
            </div>
            <div className="mb-3">
                <label htmlFor="Correo" className="form-label">Correo</label>
                <input onChange={handleChange} type="text" id="Correo" className="form-control"/>
            </div>
            <button className="btn btn-primary">Enviar</button>
        </form>
    );
}

export default Form;
